import React from 'react';
import DayJS from 'react-dayjs';

const Header = () => {
  return (
    <header>
        <h1>Grocery List</h1>
        <DayJS format="MM-DD-YYYY">2000-01-31T11:59:00-05:00</DayJS>
    </header>
  );
}

export default Header;
